{"result":{"response":{"webSearchResults":{"results":[{"url":"https://en.wikipedia.org/wiki/Presidency_of_Joe_Biden","title":"Presidency of Joe Biden - Wikipedia","preview":"Joe Biden's tenure as the 46th president of the United States began with his inauguration on January 20, 2021, and ended on January 20, 2025. Biden, a member of the Democratic Party who previously served as vice president for two terms under President Barack Obama from 2009 to 2017, took office after his victory in the 2020 presidential election over the incumbent president, Donald Trump of the Republican Party. Upon his inauguration, he became the oldest president in American history, breaking the record set by Ronald Reagan. Biden entered office amid the COVID-19 pandemic, an economic crisis, and increased political polarization. Day one actions of his presidency included restoring U.S. participation in the Paris Agreement, revoking the permit for the Keystone XL pipeline and halting funding for the Mexico–United States border wall. On his second day, he issued a series of executive orders to reduce the impact of COVID-19, including invoking the Defense Production Act of 1950, and set an early goal of achieving one hundred million COVID-19 vaccinations in the United States in his first 100 days.","searchEngineText":"","description":"Joe Biden's tenure as the 46th president of the United States began with his inauguration on January 20, 2021, and ended on January 20, 2025. Biden, a member of the Democratic Party who previously served as vice president for two terms under President Barack Obama from 2009 to 2017, took office after his victory in the 2020 presidential election over the incumbent president, Donald Trump of the Republican Party. Upon his inauguration, he became the oldest president in American history, breaking the record set by Ronald Reagan. Biden entered office amid the COVID-19 pandemic, an economic crisis, and increased political polarization. Day one actions of his presidency included restoring U.S. participation in the Paris Agreement, revoking the permit for the Keystone XL pipeline and halting funding for the Mexico–United States border wall. On his second day, he issued a series of executive ...","siteName":"","metadataTitle":"","creator":"","image":"","favicon":"https://imgs.search.brave.com/J-BbF9nYOMrLw_mnL36oGqyzMpHP6q9HxYOpKvt4JH8/rs:fit:64:0:0:0/g:ce/aHR0cDovL2Zhdmlj/b25zLnNlYXJjaC5i/cmF2ZS5jb20vaWNv/bnMvNjQwNGZhZWY0/ZTQ1YWUzYzQ3MDUw/MmMzMGY3NTQ0ZjNj/NDUwMDk5ZTI3MWRk/NWYyNTM4N2UwOTE0/NTI3ZDQzNy9lbi53/aWtpcGVkaWEub3Jn/Lw","citationId":""},{"url":"https://en.wikipedia.org/wiki/Joe_Biden","title":"Joe Biden - Wikipedia","preview":"In June 2024, Biden issued an executive action offering amnesty to unauthorized immigrants married to American citizens. The program included a pathway to U.S. residency and citizenship and was expected to initially affect about 500,000 people. It was later struck down due to a lack of legislation empowering the president to enact the program. In January 2025, Biden declared the lapsed Equal Rights Amendment ratified as the \"28th Amendment\" to the constitution. The declaration has no formal effect and the National Archives has said it does not intend to certify the amendment as part of the constitution due to \"established legal, judicial, and procedural decisions\". Biden entered office nine months into a recovery from the COVID-19 recession and his first year in office was characterized by robust growth in real GDP, employment, wages, and stock market returns, amid significantly elevated inflation.","searchEngineText":"","description":"Joseph Robinette Biden Jr. (born November 20, 1942) is an American politician who was the 46th president of the United States from 2021 to 2025. A member of the Democratic Party, he served as the 47th vice president from 2009 to 2017 under President Barack Obama, and represented Delaware in the U.S. Senate from 1973 to 2009. Born in Scranton, Pennsylvania, Biden moved