, né le 20 novembre 1942 à Scranton (Pennsylvanie), est un homme d'État américain. Membre du Parti démocrate, il est sénateur au Capitole entre 1973 et 2009 avant de devenir le 47e vice-président des États-Unis (en fonction du 20 janvier 2009 au 20 janvier 2017) puis le 46e président du pays (du 20 janvier 2021 au 20 janvier 2025). Il s'installe au Delaware après avoir quitté sa ville natale avec sa famille en 1953. Il étudie à l'université du Delaware avant d'obtenir un diplôme en droit à l'université de Syracuse en 1968. Il est élu au conseil du comté de New Castle en 1970. À 30 ans, Joe Biden devient le sixième plus jeune sénateur de l'histoire du pays, ayant été élu au Sénat des États-Unis pour le Delaware en 1972. Quelques semaines après son élection, son épouse Neilia Hunter et sa fille Naomi meurent dans un accident de la route, au cours duquel sont aussi blessés ses fils Beau et Hunter.","searchEngineText":"","description":"Joseph Robinette Biden, Jr, couramment appelé Joe Biden (/d͡ʒoʊ ˈbaɪ.dən/), né le 20 novembre 1942 à Scranton (Pennsylvanie), est un homme d'État américain. Membre du Parti démocrate, il est sénateur au Capitole entre 1973 et 2009 avant de devenir le 47e vice-président des États-Unis (en fonction du 20 janvier 2009 au 20 janvier 2017) puis le 46e président du pays (du 20 janvier 2021 au 20 janvier 2025). Il s'installe au Delaware après avoir quitté sa ville natale avec sa famille en 1953. Il étudie à l'université du Delaware avant d'obtenir un diplôme en droit à l'université de Syracuse en 1968. Il est élu au conseil du comté de New Castle en 1970. À 30 ans, Joe Biden devient le sixième plus jeune sénateur de l'histoire du pays, ayant été élu au Sénat des États-Unis pour le Delaware en 1972. Quelques semaines après son élection, son épouse Neilia ...","siteName":"","metadataTitle":"","creator":"","image":"","favicon":"https://imgs.search.brave.com/REURfZXsxlrRidctK-fZ-g1xrZKbw34OjBrgbnc_nIA/rs:fit:64:0:0:0/g:ce/aHR0cDovL2Zhdmlj/b25zLnNlYX