overnment by ending permit to export ...","siteName":"","metadataTitle":"","creator":"","image":"","favicon":"https://imgs.search.brave.com/XShSxyK9E3vty0cS73dIN7oNjxh3731zV0TljBQsjho/rs:fit:64:0:0:0/g:ce/aHR0cDovL2Zhdmlj/b25zLnNlYXJjaC5i/cmF2ZS5jb20vaWNv/bnMvNzJmYzgxOWRk/Y2FhNWI2MzQzMjQ4/MWVhZDZhNGY3ZjY0/MDgxZTM3YWU5MzYz/NGU2MzM3Y2Y2YTYz/M2IyM2Y0NC93d3cu/YnJpdGFubmljYS5j/b20v","citationId":""},{"url":"https://texaspolitics.utexas.edu/set/joe-biden-too-old-be-president-2025-october-2023","title":"Joe Biden: is too old to be president in 2025 (October 2023) | The Texas Politics Project","preview":"More Respondents were asked, \"Do you think Joe Biden is too old to be president in 2025? [GRID WITH RESPONSE OPTIONS “Yes”, “No”, “Don’t know”] [RANDOMIZE A-G]\" More Respondents were asked, \"Do you think Joe Biden is too old to be president in 2025? [GRID WITH RESPONSE OPTIONS “Yes”, “No”, “Don’t know”] [RANDOMIZE A-G]\" Measurement of Party ID for this figure is based on two questions. First, respondents were asked whether they consider themselves to be a Democrats, Republicans, independents, other, or not sure. Those who responded that they are independents or \"other\" were then asked if they lean toward either the Democrats or Republicans. If they indicated that they lean toward one party or the other, they are considered Democrats or Republicans for the purposes of this figure. Only \"pure\" independents or members of a third party who indicate that they have no preference for Democrats vis-a-vis Republicans are considered independents.","searchEngineText":"","description":"Public opinion polling and analysis from the Texas Politics Project at the University of Texas at Austin.","siteName":"","metadataTitle":"","creator":"","image":"","favicon":"https://imgs.search.brave.com/rB2neTuMFBwmadN3QH6EuihOHpGlAqvYQImZ__Skikc/rs:fit:64:0:0:0/g:ce/aHR0cDovL2Zhdmlj/b25zLnNlYXJjaC5i/cmF2ZS5jb20vaWNv/bnMvNjFlOWIwNGFj/ZWQ2Y2Y5YzYzNjUy/YTNhNjJhZWYzNzA2/NmZlMTJiNjM3OWU4/MDMyN2Q0Mj